// aschrein 2019
// Inspired by https://www.shadertoy.com/view/4llcWj

bool intersect_box(vec3 box_min,
                   vec3 box_max,
                   vec3 ray_invdir,
                   vec3 ray_origin,
                   out float hit_min,
                   out float hit_max) {
  vec3 tbot = ray_invdir * (box_min - ray_origin);
  vec3 ttop = ray_invdir * (box_max - ray_origin);
  vec3 tmin = min(ttop, tbot);
  vec3 tmax = max(ttop, tbot);
  vec2 t = max(tmin.xx, tmin.yz);
  float t0 = max(t.x, t.y);
  t = min(tmax.xx, tmax.yz);
  float t1 = min(t.x, t.y);
  hit_min = t0;
  hit_max = t1;
  return t1 > max(t0, 0.0);
}

bool intersect_plane(vec3 p, vec3 n, vec3 ray, vec3 ray_origin, out vec3 hit) {
  vec3 dr = ray_origin - p;
  float proj = dot(n, dr);
  float ndv = dot(n, ray);
  if (proj * ndv > -1.0e-6) {
    return false;
  }
  float t = proj / ndv;
  hit = ray_origin - ray * t;
  return true;
}


// This is the function that samples volume density(0.0 or 1.0)
float sample_volume(
    ivec3 cell_id,
	uvec3 ug_bins
	) {
	if (
        cell_id.x < 0 || cell_id.x >= int(BINS_X) ||
        cell_id.y < 0 || cell_id.y >= int(BINS_Y) ||
        cell_id.z < 0 || cell_id.z >= int(BINS_Z)
    )
        return 0.0f;
    uint cell_id_offset = uint(cell_id[2]) * ug_bins[0] * ug_bins[1] +
                        uint(cell_id[1]) * ug_bins[0] + uint(cell_id[0]);
    uint texel_id = uint(cell_id_offset) / 4u;
    uint texel_x = texel_id % uint(iResolution.x);
    uint texel_y = texel_id / uint(iResolution.x);
    vec4 chunk = texture(iChannel0, vec2(float(texel_x) + 0.5, float(texel_y) + 0.5) / iResolution.xy);
    return chunk[cell_id_offset % 4u];
}

bool iterate(vec3 ray_dir,
             vec3 ray_invdir,
             vec3 camera_pos,
             // results of intersect_box
             float hit_min,
             float hit_max,
             // Uniform grid parameters
             vec3 ug_min,
             vec3 ug_max,
             // bins count in each dimension
             uvec3 ug_bins,
             // bin size is uniform i.e. vec3(bin_size, bin_size, bin_size)
             float bin_size,
             out int iter,
             out float out_val
            ) {
  uint total_bins = ug_bins.x * ug_bins.y * ug_bins.z;
  vec3 ray_origin = camera_pos + ray_dir * hit_min;
  ivec3 exit, step, cell_id;
  vec3 axis_delta, axis_distance;
  for (uint i = 0u; i < 3u; ++i) {
    // convert ray starting point to cell_id coordinates
    float ray_offset = ray_origin[i] - ug_min[i];
    cell_id[i] = int(clamp(floor(ray_offset / bin_size), 0.0,
                           float(total_bins) - 1.0));
    if (ray_dir[i] < 0.0) {
      axis_delta[i] = -bin_size * ray_invdir[i];
      axis_distance[i] =
          (float(cell_id[i]) * bin_size - ray_offset) * ray_invdir[i];
      step[i] = -1;
    } else {
      axis_delta[i] = bin_size * ray_invdir[i];
      axis_distance[i] =
          (float(cell_id[i] + 1) * bin_size - ray_offset) * ray_invdir[i];
      step[i] = 1;
    }
  }
  uint cell_id_offset = uint(cell_id[2]) * ug_bins.x * ug_bins.y +
                        uint(cell_id[1]) * ug_bins.x + uint(cell_id[0]);

  ivec3 cell_delta = step;
  iter = 0;
  out_val = 0.0;

  uint k = (uint(axis_distance[0] < axis_distance[1]) << 2) +
             (uint(axis_distance[0] < axis_distance[2]) << 1) +
             (uint(axis_distance[1] < axis_distance[2]));
  const uint map[] = uint[](2u, 1u, 2u, 1u, 2u, 2u, 0u, 0u);
  uint axis = map[k];
  while (true) {


    float v_val0 = sample_volume(cell_id, ug_bins);
    if (v_val0 > 0.5) {
        iter++;
        //vec3 normal = vec3(0.0, 0.0, 0.0);
        //normal[axis] = 1.0;
        //normal *= sign(dot(ray_dir, normal));
        //out_val = clamp(dot(normal, normalize(vec3(0.3, 0.1, -1.0))), 0.0, 1.0);
        //return true;
    }

    k = (uint(axis_distance[0] < axis_distance[1]) << 2) +
             (uint(axis_distance[0] < axis_distance[2]) << 1) +
             (uint(axis_distance[1] < axis_distance[2]));
    const uint map[] = uint[](2u, 1u, 2u, 1u, 2u, 2u, 0u, 0u);
    axis = map[k];


	cell_id[axis] += cell_delta[axis];
    if (cell_id[axis] < 0 || cell_id[axis] >= int(ug_bins[axis]))
      break;

    axis_distance[axis] += axis_delta[axis];
  }
  return iter != 0;
}




void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = fragCoord/iResolution.xy;

    vec2 ty = 2.0 * uv - 1.0;

    float aspect = iResolution.x / iResolution.y;
    float camera_distance = length(vec3(SIZE_X, SIZE_Y, SIZE_Z)) * 0.7;
    vec3 camera_up = vec3(0.0, 0.0, 1.0);
    vec3 camera_lookat = vec3(0.0, 0.0, SIZE_Z)/2.0;
    vec2 mouse_uv = iMouse.xy / iResolution.xy;
    vec3 camera_pos = camera_distance * vec3(
        sin(mouse_uv.y * 10.0 + 3.141592/2.0) * cos(mouse_uv.x * 10.0),
        sin(mouse_uv.y * 10.0 + 3.141592/2.0) * sin(mouse_uv.x * 10.0),
        cos(mouse_uv.y * 10.0 + 3.141592/2.0)
    ) + camera_lookat;

    vec3 camera_look = normalize(camera_lookat - camera_pos);
    vec3 camera_left = normalize(cross(camera_look, camera_up));
    camera_up = normalize(cross(camera_left, camera_look));
    // PI/2 fov
    vec3 ray_dir = normalize(camera_look + ty.x * camera_left * aspect + ty.y * camera_up);

    vec3 val = abs(1.0 / ray_dir)/100.0;

    vec3 hit_pos;
    if (intersect_plane(
        vec3(0.0, 0.0, 0.0),
        normalize(vec3(0.0, 0.0, 1.0)),
        ray_dir,
        camera_pos,
        hit_pos
    )) { 
       vec3 f = fract(vec3(hit_pos.x, hit_pos.y, 0.0)/4.0);
       if (
           abs(hit_pos.x) < 16.0 &&
           abs(hit_pos.y) < 16.0 &&
           (f.x > 0.98 || f.y > 0.98 || f.x < 0.02 || f.y < 0.02))
           val = vec3(1.0, 1.0, 1.0);
    }

    //abs(vec3(ty, 0.0));
    //vec3(0.0, 0.0, 0.0);

    float hit_min, hit_max;

    vec3 ug_min = -vec3(SIZE_X, SIZE_Y, 0.0) / 2.0;
    vec3 ug_max = vec3(SIZE_X, SIZE_Y, SIZE_Z * 2.0) / 2.0;


    if (intersect_box(
            ug_min,
            ug_max,
            1.0 / ray_dir,
            camera_pos,
            hit_min,
            hit_max
    )) {

        //val = vec3(1.0, 0.0, 0.0);
        float occlusion = 0.0;
        int iter;
        if (iterate(ray_dir,
                 1.0 / ray_dir,
                 camera_pos,
                 hit_min,
                 hit_max,
                 ug_min,
            	 ug_max,
                 uvec3(BINS_X, BINS_Y, BINS_Z),
                 BIN_SIZE, iter, occlusion)) {


            val = jetCubic(float(iter)/length(vec3(float(BINS_Z), float(BINS_Y), float(BINS_X))));
        }
    }

    //val = texture(iChannel0, 1.0 * fragCoord/iResolution.xy).xyz;

    fragColor = vec4(val, 1.0);
}

