// We need to get the bit at the given position
// In run length encoding we have to decode everything up until that position
// @Returns 1.0 or 0.0 as density
float decode_bit(uint target_bit_id) {
    uint current_dword_id = 0u;
    uint current_byte_id = 0u;
    uint decoded_bits = 0u;
    for(uint dummy = 0u; dummy < DATA_SIZE * 4u; dummy++) {
        // Sanity check
        if (current_dword_id >= DATA_SIZE)
            return 0.0f;
        // In my naive encoder each byte is a command, I tried 4, 8 and 16 bit encoding; 8 bits is the best
        // Byte stream is encoded in dword stream
        // The first bit indicates the run bit
        // The next 7 bits indicate the run length i.e. 1..127
        uint dword = raw_data[current_dword_id];
        uint bytes[] = uint[](
            (dword & 0xffu),
        	((dword >> 8u) & 0xffu),
            ((dword >> 16u) & 0xffu),
            ((dword >> 24u) & 0xffu)
        );

        uint byte = bytes[current_byte_id];
        uint run_bit = byte & 1u;
        uint run_length = byte >> 1u;
        if (decoded_bits + run_length > target_bit_id) {
            // We have found our bit
            return run_bit == 1u ? 1.0f : 0.0f;
        }
        current_byte_id += 1u;
        if (current_byte_id == 4u) {
            current_byte_id = 0u;
            current_dword_id++;
        }
        decoded_bits += run_length;
    }
    // Unreachable
    return 0.0f;
}

// We decode our volume and put it into the framebuffer
void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // In the first few frames we decode the volume
    // Apparently shadertoy uses a round robin of different images
    if (iFrame > 4)
        discard;

    //fragColor = vec4(1.0, 1.0, 1.0, 1.0);
    uint total_bins = BINS_X * BINS_Y * BINS_Z;
    // We're gonna put 4 volume values per pixel
    vec4 val = vec4(1.0, 1.0, 1.0, 1.0);
    for (uint comp_id = 0u; comp_id < 4u; comp_id++) {
        uint value_id = comp_id + uint((fragCoord.x - 0.5) + (fragCoord.y - 0.5) * iResolution.x) * 4u;
        if (value_id >= total_bins)
            discard;
         val[comp_id] = decode_bit(value_id);
    }

